  const numberOfUsers = 1000; // Replace with actual data
  const numberOfBookings = 500; // Replace with actual data

  return (
    <div className="App">
       {/* Render the DashboardStats component */}
       <DashboardStats
        numberOfTours={numberOfTours}
        numberOfUsers={numberOfUsers}
        numberOfBookings={numberOfBookings}
